import React from "react";
import { Link } from "react-router-dom";

function PlacesPage() {
  return (
    <div className="container">
      <h3>Accommodation</h3>
      <Link to="/account" className="btn btn-primary my-2">
        &plus, Add new place
      </Link>
      <div>
        <form onSubmit="">
          <label className="form-label my-2">Title</label>
          <input
            type="text"
            name="title"
            className="form-control"
            // value={values.name}
            // onChange={handleChange}
            placeholder="title"
          />
          <label className="form-label my-2">Address</label>
          <input
            type="text"
            name="address"
            className="form-control"
            // value={values.email}
            // onChange={handleChange}
            placeholder="address"
          />
          <label className="form-label my-2">Photos</label>
          <input
            type="file"
            name="photos"
            className="form-control"
            // value={values.password}
            // onChange={handleChange}
            placeholder="photos"
          />
          <button className="btn btn-primary my-2" type="submit">
            Submit
          </button>
        </form>
      </div>
    </div>
  );
}

export default PlacesPage;
